import React from "react";
import "./App.css";

const CountDown = (hours, minutes, seconds) => {

  return (
    <div className="timer" id="animation">
      <span> {`${hours}:${minutes}:${seconds}`} </span>
    </div>
  );
};

export default CountDown;
